import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  display: flex;
  width: 100%;
  height: 30vh;
  background-color: #e9edf1;
`;

const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 1%;
`;

const Center = styled.div`
  flex: 1;
  display: flex;
  padding: 1%;
`;
const Right = styled.div`
  flex: 1;
  display: flex;
  padding: 1%;
`;

const LogoName = styled.h2`
  font-size: 2em;
`;

const Text = styled.p`
  color: black;
  font-size: 1.2em;
  margin-top: 5%;
`;

const IconContainer = styled.div`
  display: flex;
  align-items: center;
  margin-top: 10%;
  width: 50%;
`;

const IconBG = styled.div`
  background-color: azure;
  border-radius: 50%;
  width: 40px;
  height: 40px;
`;





export default function Footer() {
  return (
    <Container>
      <Left>
        <LogoName> e-Commerce</LogoName>
        <Text>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Error, nulla quibusdam? Ullam aliquid, numquam quo ab fugit nulla, repellendus alias vitae iusto eligendi, sit esse et error obcaecati voluptatum nobis.</Text>
        <IconContainer>
          <IconBG bgColor="blue" ></IconBG>
          <IconBG bgColor="blue"></IconBG>
          <IconBG bgColor="grey"></IconBG>
          <IconBG bgColor="grey"></IconBG>
        </IconContainer>
      </Left>
      <Center>Center</Center>
      <Right>Right</Right>
    </Container>
  )
}
